INSERT INTO `conditions` (`id`, `title_ar`, `title_en`, `condition_ar`, `condition_en`, `created_at`, `updated_at`) VALUES
(2, 'الشروط والاحكام', 'Terms and conditions', '<p style=\"text-align: right;\" align=\"right\"><strong><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">شروط استخدام المنصة الالكترونية</span></strong></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">يتضمن هذا المستند شروط استخدام منصة نهل التعليمية التي بناء عليها يمكن استخدام خدمات هذه المنصة سواء بصفتك زائرًا أو مستخدما مسجلًا. يخضع استخدامك للمنصة إلى شروط الاستخدام لذا يُرجى قراءتها بعناية قبل البدء في استخدامه. </span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">إن استخدامك للمنصة يُعد بمثابة تأكيد على قبولك لشروط الاستخدام وموافقتك على الإلتزام بها وعلى ما تضمَّنته من أحكام. وفي حال عدم موافقتك على شروط الاستخدام فيجب عليك الامتناع عن استخدام المنصة</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><strong><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">حسابك وكلمة المرور الخاصة بك</span></strong></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">في حال تزويدك أو اختيارك لاسم المستخدم أو كلمة المرور أو أية معلومات أخرى نضمن الخصوصية لها كما يحق للمنصة استخدام كافة معلوماتك داخل نطاقه فقط، و يجب عليك التعامل مع هذه المعلومات على أنها معلومات سرية. وبناءً على ذلك يمنع الإفصاح عنها إلى أي شخص آخر ويحق للموقع تعطيل اسم المستخدم أو كلمة المرورعند ثبوت خلاف ذلك ،أي في حال مشاركة الاشخاص لنفس الحساب أو المعلومات</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><strong><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">الاستخدام المحظور</span></strong></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">يُسمح باستخدام المنصة فقط للأغراض المشروعة وعليه فإنه يُمنع استخدام التالي</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">:</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">مشاركة أشخاص اخرين لنفس الحساب لدخول دورة أو الاستفادة من خدمة</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">نشر أو تسريب أو اعادة كتابة أي محتوى للدورات خارج نطاق الموقع</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">استخدام أي جزء من محتوى الموقع والدورات لأغراض تجارية</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">الإعلان والتسويق التجاري الغير مصرح به لأي منتجات وخدمات</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">الإساءة والخداع واختراق خصوصية الآخرين، أو التتسبب في إزعاج لأي من مستخدمي المنصة</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><strong><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">كما أنك تلتزم بالآتي</span></strong><strong><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">:</span></strong></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">عدم إعادة إنتاج أو تكرار أو نسخ أو إعادة بيع أي جزء من المنصة والدورات</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\"> .</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">عدم تحريف هويتك أثناء التسجيل أو استخدام المنصة</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\"> .</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">عدم المطالبة باسترداد الرسوم بعد الاستفادة أوالتسجيل بأي دورة أو خدمة</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\"> .</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><strong><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">الدخول على الموقع والتعديلات</span></strong><strong><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span></strong></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">تضمن المنصة استمرارية وإتاحة محتوى الدورات والخدمات للمشتركين لما لايقل عن ثلاثة أشهر الا ما قد حدد في أي دورة أوخدمة ، كما يحق للادارة التحديث وتغيير محتوى المنصة أو الدورات أو الشروط والأحكام وفق تقديره وبأي وقت ودون اشعار مسبق وعلى ذلك يجب على الزوار والمسجلين تحديث الزيارة بشكل دوري</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><strong><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">حدود المسئولية</span></strong></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">لا تتحمل المنصة أية مسؤولية تجاه أي مستخدم عن أية خسارة أو أضرار شخصية ، بما في ذلك عدم القدرة على الاستمرار في التدريب بسبب المرض .أو بسبب انقطاع الانترنت أو الانشغال أو أي اسباب شخصية أخرى</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><strong><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">حقوق الملكية الفكرية</span></strong></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">نملك كافة حقوق الملكية الفكرية للمنصة ومحتوياته والعلامة التجارية. وجميع هذه الحقوق محفوظة ومحمية . ولا يجوز استخدام الاسم والعلامة التجارية أو أي محتوى للمنصة بما في ذلك الدورات دون الحصول على الاذن بذلك</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><strong><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">التعليق وإنهاء الحساب</span></strong></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">يؤدي عدم الالتزام بشروط الاستخدام إلى القيام باتخاذ كافة أو أي من الإجراءات التالية</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">:</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">توجيه تحذير لك</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">الايقاف الفوري أو المؤقت أو الدائم لحقك في استخدام الموقع</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">اتخاذ إجراءات نظامية وقانونية تجاهك لتعويض الموقع عن كافة التكاليف والأضرار الناتجة عن الإخلال بشروط الاستخدام (بما في ذلك، على سبيل المثال لا الحصر، نشر محتوى أو انتهاك خصوصية ! قد يؤدي لايقافك أو المقاضاة والتعويض المادي )</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p style=\"text-align: right;\" align=\"right\"><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">&nbsp;</span><span dir=\"RTL\" lang=\"AR-SA\" style=\"font-size: 10.5pt; mso-ascii-font-family: Verdana; mso-hansi-font-family: Verdana; color: #444444;\">اتخاذ أي إجراءات نظامية أخرى تجاهك وفق تقدير الموقع</span><span style=\"font-size: 10.5pt; font-family: \'Verdana\',sans-serif; color: #444444;\">.</span></p>\r\n<p class=\"MsoNormal\">&nbsp;</p>', '<p>Terms of use of the platform:</p>\r\n<p>&nbsp;</p>\r\n<p>This document includes the terms of use of the Nahal Educational Platform on which the services of this platform can be used either as a visitor or as a registered user.</p>\r\n<p>&nbsp;</p>\r\n<p>Your use of the platform is subject to terms of use so please read it carefully before you start using it. Your use of the platform is an affirmation of your acceptance of the terms of use and your consent to abide by the terms and provisions of your agreement. If you do not agree to the terms of use, you must refrain from using the platform.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Your account and password</p>\r\n<p>&nbsp;</p>\r\n<p>If you or your choice of username, password or any other information for which we guarantee privacy, the Platform has the right to use all your information within its scope only, and you must treat this information as confidential. Accordingly, it is forbidden to disclose it to any other person and the site may disable the username or password when it is proven otherwise, i.e. if people share the same account or information.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Prohibited use</p>\r\n<p>&nbsp;</p>\r\n<p>The platform is only allowed for legitimate purposes and therefore the following is prohibited:</p>\r\n<p>&nbsp;</p>\r\n<p>* Other people share the same account to enter a course or benefit from a service.</p>\r\n<p>&nbsp;</p>\r\n<p>* Post, leak or rewrite any content for courses outside the scope of the site.</p>\r\n<p>&nbsp;</p>\r\n<p>* Use any part of the site\'s content and courses for commercial purposes.</p>\r\n<p>&nbsp;</p>\r\n<p>* Advertising and marketing is not authorized for any products and services.</p>\r\n<p>&nbsp;</p>\r\n<p>* Abuse, deception, breach of the privacy of others, or disturb any users of the platform.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>You are also committed to:</p>\r\n<p>&nbsp;</p>\r\n<p>&bull; Do not reproduce, repeat, copy or resell any part of the platform and courses.</p>\r\n<p>&nbsp;</p>\r\n<p>&bull; Do not distort your identity while registering or using the platform.</p>\r\n<p>&nbsp;</p>\r\n<p>&bull; Do not claim a refund after benefiting or registering with any course or service.</p>\r\n<p>&nbsp;</p>\r\n<p>Access to the site and modifications&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>The platform guarantees continuity and availability of the content of courses and services to subscribers for at least three months except what has been specified in any course or service, and the administration has the right to update and change the content of the platform or courses or terms and conditions at any time and without prior notice, so visitors and registrants must update Visit periodically.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Limits of responsibility</p>\r\n<p>&nbsp;</p>\r\n<p>The platform assumes no liability to any user for any loss or personal damage, including the inability to continue training due to illness, internet outages, busyness or other personal reasons.</p>\r\n<p>