(1, 'public/storage/site-info/16327491718304.png', 'تعلم بلا حدود', 'تعلم بلا حدود', '<p>في أي وقت ، أي مكان ، أي جهاز</p>', '<p>Anytime, anywhere, any device</p>', NULL, 'Learning with no limit', 'في أي وقت، أي مكان، أي جهاز', 'Anytime, anywhere, any device', NULL, 'https://twitter.com/Nhl_Edu', NULL, '966500801977', '<p>منصة تدريب إلكتروني تقدم مجموعة من البرامج المتخصصة وتهتم بتقنيات التعليم لتكون (نهل) شعلة من نور في طريق الإحتراف التدريبي والوصول إلى أرقى المراتب عن طريق تقديم محتوى محترف ومتقن صممه نخبة من المختصين و المدربين ونقدمه بطريقة سهلة ومنظمة تواكب .تقنيات العصر الحديثة مما يجعلنا رائدين في المجال وقريبين لخدمتكم</p>', '<p>An electronic training platform that offers a range of specialized programs and is interested in education techniques to be (NAHL) torch from Noor in the way of professional training and reach the highest ranks by providing professional and elaborate content designed by a group of specialists and trainers and presented in an easy and organized way keeping up with the technologies of the modern era Which makes us a leader in the field and close to serving you.</p>', '<p>أن تكون شركة نهل التعليمية رائدة في التدريب الإلكتروني وتقنيات التعليم.</p>', '<p>Nahal Education company to be a leader in e-training and teaching techniques.</p>', 'نشر العلم والمعرفة.', 'استقطاب الكفاءات التدريبية المؤهلة.', 'طريقة تعلم سهلة وحديثة.', 'Spread Knowledge .', 'Hiring Qualified Trainers.', '<p>A long-established fact is that the readable content of a page will distract the reader</p>', '<p>{{}}</p>', '<p>{{}}</p>', '2019-11-24 04:37:00', '2021-09-27 11:26:11', '<p>- تمكين عملاؤنا للحصول على محتوى علمي مميز ، وتجربة تعليمية مبتكرة للوصول إلى طموحهم.</p>\r\n<p>- نشر المعرفة لكافة شرائح المجتمع بأقصر وأسهل تقنية.</p>\r\n<p>&nbsp;</p>', '<p>- Empowering our customers to get distinctive scientific content and an innovative learning experience to reach their ambition.</p>\r\n<p>- Spreading knowledge to all segments of society in the shortest and easiest technique.</p>\r\n<p>&nbsp;</p>', NULL, NULL, 'public/storage/site-info/16327491718181.png', NULL, NULL, NULL, NULL);
